import React from "react";
import { Link } from "react-router-dom";
import CategorySubPage from "../components/CategorySubPage";
import ChallengesTable from "../components/ChallengesTable";
import challengeData from "../challengeData";

const BinaryExploitationChallenges = () => {
  const challenges = challengeData.binaryExploitation.map(challenge => ({
    id: challenge.id,
    name: challenge.title,
    difficulty: challenge.difficulty || "N/A", // Add difficulty to your JSON if not present
    points: challenge.points || 100,
    completed: false, // You might want to manage this state elsewhere
    path: `/binary-exploitation/challenge/${challenge.id}`
  }));

  const challengesContent = (
    <ChallengesTable 
      challenges={challenges} 
      categoryPath="/binary-exploitation"
    />
  );

  return (
    <CategorySubPage
      title="Binary Exploitation Challenges"
      content={challengesContent}
      buttons={[
        {
          text: "Back to Overview",
          path: "/binary-exploitation",
          variant: "secondary",
        },
      ]}
    />
  );
};

export default BinaryExploitationChallenges;
